INSERT INTO `careers` (`id`, `key`, `name`, `description`, `income`, `startmoney`, `exp_speed`, `created_at`, `updated_at`) VALUES
(1, 'banker', 'Fondmanager', 'If you become a banker your life on the stock market will become a lot easier, because you are well trained in this business.\r\n\r\nYou won’t have a a big monthly income - your life depends on the game.\r\n', 750, 50000, 150, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2, 'gangster', 'Gangster Boss', 'Welcome to the dark side. The gangster boss is not experienced in trading stocks but he knows how to make money and how to break the law.\r\n\r\nBeware of the FBI agents, which already have a look at you.\r\n', 2000, 75000, 100, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(3, 'hacker', 'Hacker', 'You have just dropped out of IT-collage to become invisible to the public and make money on the market.\r\nClubs are always looking out for high level hackers, that are able to ruin their opponents. So better keep your true identity secret, or your victims will find you in your mothers basement.', 1000, 25000, 50, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
